import React, { useState, useEffect } from 'react';

const Counter = () => {
  const [count, setCount] = useState(0);
  useEffect(() => {
    const handleChange = () => {
      setCount(count++);
    }
  });
  return (
    <>
      <h1>Counter: {count} </h1>
      <button onClick={() => handleChange}> Add 1 </button>
    </>
  );
}

export default Counter;
